    [],nt"revision_timestamp": "2016-04-11T19:08:19.394845",nt"name": "humboldt-bay-benthic-habitats-2009-aquatic-setting",nt"isopen":
    false,nt"url": null,nt"notes": "Humboldt Bay is the largest estuary in
    California north of San Francisco Bay and represents a significant resource for
    the north coast region. Beginning in 2007 the Coastal Services Center began collaborating
    with the California SeaGrant program and other local partners to support an ecosystem-based
    management (EBM) project for Humboldt Bay. One element of this project was to develop
    subtidal habitat goals for the long-term management of the bay and provide a framework
    for conservation and management across the land-sea interface. An aerial imagery-based
    mapping effort was conducted between 2008 and 2010 which produced a shallow benthic
    habitat map classified using the Florida System for Classifying Habitats in Estuarine
    and Marine Environments (SCHEME) system. This effort resulted in a single polygon
    shapefile which was later converted to the Coastal and Marine Ecological Classification
    Standard (CMECS)classification and organized into separate feature layers for three
    CMECS components; geoform, substrate, and biotic. Aquatic setting layers (#1 and
    #2) were produced to further populate the CMECS data structure. Ancillary data was
    used to accomplish this process in 2015.",nt"license_title": null,nt"extras":
